import Button from "../UI/Button/Button";
import SubHeaderPage from "./SubHeader";
import HeaderMobileLayout from "./HeaderMobile";

import classes from "./header.module.css";

import { Link } from "react-router-dom";

import { BagIcon } from "../Ui icons/Bag";
import { MessagesIcon } from "../Ui icons/Messages";
import { PaymentsIcon } from "../Ui icons/Payments";
import { BellIcon } from "../Ui icons/Bell";
import { AtlassianCircleIcon } from "../Ui icons/AtlassianCircle";
import { ArrowDownIcon } from "../Ui icons/ArrowDown";
import { HamburgerIcon } from "../Ui icons/Hamburger";

function Header() {
  function handleHamburger() {
    console.log("dalal");
  }

  return (
    <header>
      <nav className={classes.main_nav}>
        <Button size="lg" theme="main" styles={classes.logo_size}>
          Logo
        </Button>
        <div className={classes.middle_nav}>
          <Button size="lg" theme="dark" Icon="">
            <span className="button_items_linear">
              <BagIcon classes="margin_right" />
              Jobs
            </span>
          </Button>
          <Button size="lg" theme="text" styles={classes.middle_nav_text_links}>
            <span className="button_items_linear">
              <MessagesIcon
                classes="margin_right"
                fill="rgba(180, 180, 180, 0.4)"
              />
              Message
            </span>
          </Button>
          <Button size="lg" theme="text" styles={classes.middle_nav_text_links}>
            <span className="button_items_linear">
              <PaymentsIcon
                classes="margin_right"
                fill="rgba(180, 180, 180, 0.4)"
              />
              Payment
            </span>
          </Button>
        </div>
        {/* .lins_wrapper */}
        <div className="right_nav">
          {/* <span className={classes.links_wrapper}>
            <Button size="sm" theme="text">
              <BellIcon classes={`margin_right ${classes.padding_none}`} />
            </Button>
            <Button size="sm" theme="text">
              <AtlassianCircleIcon
                classes={`margin_right ${classes.padding_none}`}
              />
            </Button>
          </span> */}
          <span className={classes.links_wrapper}>
            <Button theme="text" classes={classes.d_none}>
              <BellIcon />
            </Button>
            <Button theme="text">
              <AtlassianCircleIcon classes={classes.d_none} />
            </Button>
            <Button theme="text" classes={classes.d_none}>
              <ArrowDownIcon />
            </Button>
            <Button
              theme="text"
              styles={classes.render_mobile}
              onClick={handleHamburger}
            >
              <HamburgerIcon />
            </Button>
          </span>
        </div>
        {/* mobile */}
        <HeaderMobileLayout />
      </nav>
      <SubHeaderPage />
    </header>
  );
}

export default Header;
